import React from "react";
import '../css/MenuCopy.css';
export default function MenuCopy(){
    return(
        <>
            <div className="Menu sidebar">
            <div className="LOGO">
                <h2>Stg Community</h2>
                <img src={require('../Ressources/Logo_ofppt.png')} alt="Logo_ofppt"/>
            </div>
            </div>
        </>
    )
}
